#include <stdio.h>

void read(int array[], int length) {
	for (int i = 0; i < length;  ++ i) {
		scanf("%d", &array[i]);
	}
}

int main() {
	int prices[10];
	read(prices, 10);
	int weights[10];
	read(weights, 10);
	int maxWeight;
	scanf("%d", &maxWeight);

	printf("%d", knapsack(prices, weights, maxWeight)); 
}

int max(int x,int y){
	if(x>y) return x;
	else return y;
}
int max_price_memory[1000]={0};
int knapsack(int prices[],int weights[],int maxWeight){
	int maxPrice = 0;
	if(max_price_memory[maxWeight]>0){
		maxPrice=max_price_memory[maxWeight];
	}
	for (int i = 0; i < 10; ++ i){
		int current_price = 0;
		if(maxWeight==weights[i]){
			maxPrice = prices[i];
		}
		else{
		 current_price = knapsack(prices,weights,weights[i])+knapsack(prices,weights,maxWeight-weights[i]);
		}
		if(current_price>maxPrice){
			maxPrice = current_price;
		}
		max_price_memory[maxWeight]=maxPrice;
	}
	return maxPrice;
}
